import React, { useState } from 'react';
import { AuthProvider } from './contexts/AuthContext';
import Navbar from './components/Navbar';
import Home from './components/Home';

function AppContent() {
  const [currentView, setCurrentView] = useState('home');
  const [selectedStartup, setSelectedStartup] = useState(null);

  const handleStartupClick = (startup) => {
    setSelectedStartup(startup);
    setCurrentView('startup-detail');
  };

  const renderView = () => {
    switch (currentView) {
      case 'startup-detail':
        return <div className="p-8 text-center">Startup Detail View Coming Soon...</div>;
      case 'jobs':
        return <div className="p-8 text-center">Jobs View Coming Soon...</div>;
      case 'profile':
        return <div className="p-8 text-center">Profile View Coming Soon...</div>;
      case 'auth':
        return <div className="p-8 text-center">Auth View Coming Soon...</div>;
      default:
        return <Home onStartupClick={handleStartupClick} />;
    }
  };

  return (
    <div className="min-h-screen bg-gradient-to-br from-gray-50 to-blue-50">
      <Navbar currentView={currentView} onViewChange={setCurrentView} />
      {renderView()}
    </div>
  );
}

function App() {
  return (
    <AuthProvider>
      <AppContent />
    </AuthProvider>
  );
}

export default App;
